import '../../App.css'
import {React, setState, useState} from 'react'
import CardItem from '../CardItem'
import {Link} from 'react-router-dom';
import { Button } from '../Button';
import backgroundVideo from '../../videos/video-3.mp4'
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';

import {Input,
        OutlinedInput,
        InputAdornment,
        InputLabel,
        IconButton,
        FormControl,
        TextField,
        Paper, 
        FormGroup } from '@material-ui/core';

export default function SignUpFormCreator(){
    const [password, setPassword] = useState("");
    const [confirmPassword, setConfirmPassword] = useState("");
    const [email, setEmail] = useState("");
    const [showPassword, setShowPassword] = useState(false);
    const [showConfirmPassword, setShowConfirmPassword] = useState(false);

    function handleChange(value, event){
        if(value === "email")
            setEmail(event.target.value);
        else if(value === "password"){
            setPassword(event.target.value);
        }else if(value === "confirm password"){
            setConfirmPassword(event.target.value);
        }
    }
    const handleClickShowPassword =()=> setShowPassword(!showPassword);

    const handleMouseDownPassword = (event) => {
        event.preventDefault();
      };

    return (
        <div className="paper_body">
        <video autoPlay loop muted>
            <source src={backgroundVideo} type='video/mp4'/>
        </video>
            <form className="register_form">
                <FormControl className=''>
                    <FormControl required fullWidth margin="normal">
                        <InputLabel htmlFor="name" className="label">
                            Name
                        </InputLabel>
                        <Input
                            name="name"
                            type="name"
                            autoComplete="name"
                            // className={classes.inputs}
                            disableUnderline={false}

                            onChange={(e)=>handleChange("name", e)}
                        />
                    </FormControl>
                    <FormControl required fullWidth margin="normal">
                        <InputLabel htmlFor="surname" className="label">
                            Surname
                        </InputLabel>
                        <Input
                            name="Surname"
                            type="Surname"
                            autoComplete="Surname"
                            // className={classes.inputs}
                            disableUnderline={false}
                            onChange={(e)=>handleChange("Surname", e)}
                        />
                    </FormControl>
                    <FormControl required fullWidth margin="normal">
                        <InputLabel htmlFor="email" className="label">
                            E-mail
                        </InputLabel>
                        <Input
                            name="email"            
                            type="email"
                            autoComplete="email"
                            // className={classes.inputs}
                            disableUnderline={false}
                            onChange={(e)=>handleChange("email", e)}/>
                    </FormControl>
                    <FormControl required fullWidth margin="normal">
                        <InputLabel htmlFor="password" className="label">Password</InputLabel>
                        <Input
                            id="password"
                            type={showPassword ? 'text' : 'password'}
                            value={password}
                            onChange={(e) => handleChange('password', e)}
                            endAdornment={
                            <InputAdornment position="end">
                                <IconButton
                                    aria-label="toggle password visibility"
                                    onClick={handleClickShowPassword}
                                    onMouseDown={handleMouseDownPassword}
                                    edge="end">
                                {showPassword ? <VisibilityOff /> : <Visibility />}
                                </IconButton>
                            </InputAdornment>
                            }
                            label="Password"
                        />
                    </FormControl>
                    <FormControl sx={{ m: 1, width: '25ch' }}>
                        <InputLabel htmlFor="confirm_password" className="label">Confirm Password</InputLabel>
                        <Input
                            id="confirm_password"
                            type={showConfirmPassword ? 'text' : 'password'}
                            value={confirmPassword}
                            onChange={(e) => handleChange('confirm password', e)}
                            endAdornment={
                            <InputAdornment position="end">
                                <IconButton
                                    aria-label="toggle password visibility"
                                    onClick={handleClickShowPassword}
                                    onMouseDown={handleMouseDownPassword}
                                    edge="end">
                                {showConfirmPassword ? <VisibilityOff /> : <Visibility />}
                                </IconButton>
                            </InputAdornment>
                            }
                            label="Confirm Password"/>
                    </FormControl>
                </FormControl>
            </form>
        </div>
    );
}
